import React, { Component } from "react";

const UserGet = () => {
    var myHeaders = new Headers();
    myHeaders.append("Content-Type", "application/json");
    
    var raw = JSON.stringify({
      "USER_ID": 6,
      "MOTORCYCLE_BALANCE": "23234",
      "MOTORCYCLE_PRICE": "234234",
      "MOTORCYCLE_BRAND": "sdf",
      "MOTORCYCLE_MODEL": "scsv",
      "MOTORCYCLE_COLOR": "dfsdf",
      "MOTORCYCLE_REGISTRATION_NUMBER": "dfsdfsd",
      "MOTORCYCLE_BUCKET_NUMBER": "sdfsdf",
    });
    
    var requestOptions = {
      method: 'GET',
      headers: myHeaders,
      body: raw,
      redirect: 'follow'
    };
    
    fetch("http://localhost:3001/api/v1/users", requestOptions)
      .then(response => response.text())
      .then(result => console.log(result))
      .catch(error => console.log('error', error));
  };

function UserInfoAdmin() {
  return <div>ChassisAdmin</div>;
}

export default UserInfoAdmin;
